function ensureDirectoryExists(dirPath) {
  if (!fs.existsSync(dirPath)) {
    fs.mkdirSync(dirPath, { recursive: true });
    console.log(`üìÅ ÿ™ŸÖ ÿ•ŸÜÿ¥ÿßÿ° ÿßŸÑŸÖÿ¨ŸÑÿØ: ${dirPath}`);
  }
}

function copyIconToFolder(iconPath, targetFolder, fileName) {
  try {
    ensureDirectoryExists(targetFolder);
    const targetPath = path.join(targetFolder, fileName);
    
    if (fs.existsSync(iconPath)) {
      fs.copyFileSync(iconPath, targetPath);
      console.log(`‚úÖ ŸÜÿ≥ÿÆ ${fileName} ÿ•ŸÑŸâ ${targetFolder}`);
      return true;
    } else {
      console.log(`‚ùå ŸÑŸÖ Ÿäÿ™ŸÖ ÿßŸÑÿπÿ´Ÿàÿ± ÿπŸÑŸâ ${iconPath}`);
      return false;
    }
  } catch (error) {
    console.log(`‚ùå ÿÆÿ∑ÿ£ ŸÅŸä ŸÜÿ≥ÿÆ ${fileName}: ${error.message}`);
    return false;
  }
}

function verifyFileExists(filePath) {
  if (fs.existsSync(filePath)) {
    const stats = fs.statSync(filePath);
    console.log(`‚úÖ ${path.basename(filePath)} ŸÖŸàÿ¨ŸàÿØ - ÿßŸÑÿ≠ÿ¨ŸÖ: ${stats.size} ÿ®ÿßŸäÿ™`);
    return true;
  } else {
    console.log(`‚ùå ${path.basename(filePath)} ÿ∫Ÿäÿ± ŸÖŸàÿ¨ŸàÿØ`);
    return false;
  }
}

